import React from 'react';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom for navigation
import benzImage1 from '../assests/benz1.webp'; // Import Benz images
import benzImage2 from '../assests/benz1.webp';
import benzImage3 from '../assests/benz1.webp';
// Import other Benz images as needed

const BenzCollectionPage = () => {
    return (
        <div style={{ backgroundColor: 'black', minHeight: '100vh', padding: '20px' }}>
            <h1 style={{ color: 'white' }}>BENZ</h1>
            <div style={{ display: 'flex', justifyContent: 'center' }}>
                <div style={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'center' }}>
                    <Link to="/benz-info-1">
                        <img src={benzImage1} alt="Benz 1" style={{ width: '300px', height: '200px', margin: '10px' }} />
                    </Link>
                    <Link to="/benz-info-2">
                        <img src={benzImage2} alt="Benz 2" style={{ width: '300px', height: '200px', margin: '10px' }} />
                    </Link>
                    <Link to="/benz-info-3">
                        <img src={benzImage3} alt="Benz 3" style={{ width: '300px', height: '200px', margin: '10px' }} />
                    </Link>
                    {/* Add more links and images for other Benz collections */}
                </div>
            </div>
        </div>
    );
};

export default BenzCollectionPage;
